import * as Effect from "effect/Effect";
import { pipe } from "effect/Function";
import type { RequestHandler } from "express";
import { match } from "ts-pattern";

import type { departmentMemberships } from "../../core/schema/index.js";
import { type InviteCandidate, parseInvite } from "./auth-helpers.js";
import {
  type DbError,
  fetchInvitations,
  findMembershipByUserId,
  insertInvitation,
  type InvitationActionError,
  revokePendingInvitation,
} from "./invitations-effect.js";
import {
  DEFAULT_INVITE_EXPIRATION_HOURS,
  generateToken,
  type InvitationError,
  type InvitationQuery,
  type InvitationsResponse,
  parseEmailFilter,
  parseStatusFilter,
  toInvitationView,
  toIso,
} from "./invitations-helpers.js";

type MembershipRole = typeof departmentMemberships.$inferSelect.role;

const adminRoles: ReadonlyArray<MembershipRole> = [
  "super_admin",
  "admin",
  "manager",
];

const forwardDbErrors = (
  next: Parameters<RequestHandler>[2],
): (effect: Effect.Effect<void, DbError>) => Effect.Effect<void> =>
(effect) =>
  pipe(
    effect,
    Effect.catchAll((err: { readonly cause: Error }) =>
      Effect.sync(() => {
        next(err.cause);
      })
    ),
  );

const runRouteProgram = (
  program: Effect.Effect<void, DbError>,
  next: Parameters<RequestHandler>[2],
): void => {
  void Effect.runPromise(program).catch(next);
};

// CHANGE: Admin guard through Effect with typed DB errors
// WHY: Preserve pure core and explicit effect boundary
// QUOTE(TZ): "–ú—ã –≤—Å–µ–≥–¥–∞ –≤—Å—ë –æ–ø–∏—Å—ã–≤–∞–µ–º —Ä–µ–∞–ª—å–Ω—ã–º–∏ —Ç–∏–ø–∞–º–∏"
// PURITY: SHELL
// EFFECT: Effect<void, DbError, never>
// INVARIANT: userId ‚àà session ‚Üí adminRoles.includes(role) ‚Üí next invoked
// COMPLEXITY: O(1)
export const requireAdmin: RequestHandler = (req, res, next) => {
  const { userId } = req.session;
  if (!userId) {
    res.status(401).json({ error: "unauthorized" });
    return;
  }
  const program = pipe(
    findMembershipByUserId(userId),
    Effect.flatMap((membership) =>
      membership && adminRoles.includes(membership.role)
        ? Effect.sync(() => {
          next();
        })
        : Effect.sync(() => {
          res.status(403).json({ error: "forbidden" });
        })
    ),
    Effect.catchAll((err) =>
      Effect.sync(() => {
        next(err.cause);
      })
    ),
  );
  Effect.runPromise(program).catch(next);
};

